<html>
<head>
<style>
    body {
 background-color: black;
 background-image: url('your-image-url-here');
 background-size: 100% 177.78%;
 background-repeat: no-repeat;
 color: white;
 }
 .H1{
  color: black;
  text-align: center;
 }
 .container {
 display: flex;
 flex-direction: column;
 align-items: center;
 }
.grid-container {
  display: grid;
  grid-template-columns: auto;
  padding: 10px;
}
.button_menu{
    background-color: blue;
    display: grid;
      grid-template-columns: auto auto auto auto;
      padding: 10px;
}


</style>
</head>
